$('body').on('click', '.saveTarget', function() {

    const target = $(this).attr('data-target')

    const existed = savedTargets.queryAll('data', {
        query: {target}
    })

    if (existed.length === 0) {

        savedTargets.insert('data', {target})

        $(this).removeClass('bg-white').removeClass('border').addClass('saved').addClass('btn-success')

        notyf.success({message: 'Đã lưu!'})

    } else {

        savedTargets.deleteRows('data', {target})

        $(this).removeClass('btn-success').removeClass('saved').addClass('border').addClass('bg-white')

        notyf.success({message: 'Đã xóa!'})
    }

    savedTargets.commit()

})

